import React from "react";
import { Card } from "antd";
const PostCard = () => {
  return (
    <div>
      <Card
        cover={
          postMessage.Images[0] && <PostImages images={postMessage.Images} />
        }
        actions={[<RetweetOutlined />]}
      >
        <Image />
        <Content />
        <Buttons></Buttons>
      </Card>
      <CommentForm />
      <Comments />
    </div>
  );
};

export default PostCard;
